uber','PO:0004548','An axillary shoot with a swollen stem.\\n [POC:curators]'),(40,'aleurone layer','PO:0005360','The outermost endosperm tissue of the seeds\\, its cells being characterized by presence of protein bodies containing seed storage proteins. [ISBN:0080374913, GR:pj]'),(41,'androecium','PO:0009061','Collectively the stamens of one flower. [APWeb:Glossary, GR:pj]'),(43,'androecium (sensu Zea)','PO:0006471','Collectively the stamens of one floret of a maize plant. [GR:pj]'),(44,'androecium of ear floret','PO:0006355','Collectively the stamens of maize ear floret.  [GR:pj]'),(54,'angular collenchyma','PO:0005621','OBSOLETE. A form of collenchyma in which the primary wall thickening is most prominent in the angles where three or more cells are joined. [GR:pj, ISBN:0080374913]'),(55,'anther','PO:0009066','The pollen-bearing part of a stamen. [APWeb:Glossary]'),(56,'anther (sensu Poaceae)','PO:0006442','The pollen-bearing part of a stamen of a grass floret. [GR:pj]'),(57,'anther (sensu Zea)','PO:0006473','The pollen-bearing part of a stamen of a maize floret. [GR:pj]'),(58,'anther primordium','PO:0006089','An organized group of cells that will differentiate into anther.  [GR:pj]'),(59,'anther wall','PO:0000002','A multicellular layer with outer epidermis and an inner endothecium. [GR:pj]'),(61,'anther wall (sensu Zea)','PO:0006477','A multicellular layer with outer epidermis and an inner endothecium of an anther of a maize stamen. [GR:pj]'),(62,'antipodal cell','PO:0020093','Cell\\, commonly three in number as in the eight-nucleate embryo sac\\, located at the other end of the embryo sac from the female gamete.  [APWeb:Glossary]'),(63,'antiraphe','PO:0020028','The region on the other side of the ovule from the raphe. [APWeb:Glossary]'),(64,'apical cell','PO:0004000','The uppermost cell formed after the first division of the zygote. [ISBN:0471245208]'),(65,'apical hook','PO:0000012','Hook-like structure which develops at the apical part of the hypocotyl in dark