ot. [GR:ap]'),(86,'basal cell','PO:0002002','The lowermost cell formed after the first division of the zygote. [ISBN:0471245208]'),(87,'bract','PO:0009055','A leaf\\, usually different in form from the foliage leaves\\, subtending a flower or inflorescence. [APWeb:Glossary]'),(88,'bracteole','PO:0009043','A small leaf or leaves borne singly or in pairs on the pedicel\\, the prophyll(s) of the flower-shoot (pedicel plus flower). [APWeb:Glossary]'),(89,'bud scale','PO:0020054','A reduced leaf surrounding a dormant bud. [UMSL:tk]'),(90,'bulliform cell','PO:0004001','An enlarged more or less thin-walled epidermal cell present\\, with other similar cells\\, in longitudinal rows in leaves of monocots. [ISBN:0471245208]'),(91,'bundle sheath','PO:0006023','A layer or layers of cells surrounding the vascular bundles of leaves. It may consist of parenchyma or sclerenchyma. [ISBN:0080374913]'),(92,'bundle sheath extension','PO:0006022','A strip of ground tissue present along the leaf veins and extending from the bundle sheath to the epidermis. It may be present on one or both sides of the vein and may consist of parenchyma or sclerenchyma. [ISBN:0080374913]'),(93,'callus','PO:0005052','A tissue formed as a result of wounding\\, or a tissue developing in a tissue culture. [GR:pj]'),(94,'calyx','PO:0009060','The sepals of one flower collectively. [APWeb:Glossary]'),(95,'cambial initial','PO:0000295','Cell in the vascular or cork cambium which by periclinal divisions produce cells to the outside or inside of the cambial axis. [POC:curators]'),(96,'cambium','PO:0005597','A lateral meristem\\, the cells of which divide mostly periclinally.  [ISBN:0080374913]'),(98,'carpel','PO:0009030','A megasporophyll\\, almost always at the center of a flower\\, its margins more or less fused together or with other carpels to enclose the ovule(s).\\n [APWeb:Glossary]'),(99,'carpel (sensu Poaceae)','PO:0006455','A megasporophyll at the center of a grass floret enclosing the ovule. [GR:pj]'),(100,